//github.com/zippyui/react-menus">react-menus</a> for more info.</p>\n<code class="codeBlock"><span class="token comment" spellcheck="true">// This can be either a static array or a function to build a dynamic menu based on the thing that is clicked.\n</span><span class="token keyword" >const</span> menu_items <span class="token operator" >=</span> <span class="token punctuation" >(</span>props<span class="token punctuation" >)</span> <span class="token operator" >=</span><span class="token operator" >></span> <span class="token punctuation" >{</span>\n    <span class="token keyword" >return</span> <span class="token punctuation" >[</span>\n        <span class="token punctuation" >{</span>\n            label<span class="token punctuation" >:</span> <span class="token string" >\'Label 1\'</span>                <span class="token comment" spellcheck="true">// The actual text that gets displayed\n</span>            onClick<span class="token punctuation" >:</span> <span class="token punctuation" >(</span>event<span class="token punctuation" >,</span> props<span class="token punctuation" >)</span> <span class="token operator" >=</span><span class="token operator" >></span> <span class="token punctuation" >{</span><span class="token punctuation" >}</span>   <span class="token comment" spellcheck="true">// A function that gets called on click of menu item. It receives the props of the wrapped component.\n</span>        <span class="token punctuation" >}</span><span class="token punctuation" >,</span>\n        <span class="token string" >\'-\'</span><span class="token punctuation" >,</span>\n        <span class="token punctuation" >{</span>\n            label<span class="token punctuation" >:</span> <span class="token string" >\'Label 2\'</span><span class="token punctuation" >,</span>\n            disabled<span class="token punctuation" >:</span> <span class="token primitive" >true</span>                  <span class="token comment" spellcheck="true">// Disable the item. Defaults to false.\n</span>        <span class="token punctuation" >}</span>\n    <span class="token punctuation" >]</span><span class="token punctuation" >;</span>\n<span class="token punctuation" >}</span></code><p>Options are defined as such:</p>\n<code class="codeBlock"><span class="token comment" spellcheck="true">// This can be either a static object or a function to build a dynamic object based on the thing that is clicked.\n</span><span class="token keyword" >const</span> options <span class="token operator" >=</span> <span class="token punctuation" >(</span>props<span class="token punctuation" >)</span> <span class="token operator" >=</span><span class="token operator" >></span> <span class="token punctuation" >{</span>\n    <span class="token keyword" >return</span> <span class="token punctuation" >{</span>\n        theme<span class="token punctuation" >:</span> props<span class="token punctuation" >.</span>theme<span class="token punctuation" >.</span>theme<span class="token punctuation" >,</span>           <span class="token comment" spellcheck="true">// The theme object is applied to items\n</span>        style<span class="token punctuation" >:</span> props<span class="token punctuation" >.</span>theme<span class="token punctuation" >.</span>style<span class="token punctuation" >,</span>           <span class="token comment" spellcheck="true">// The style object is applied to the overall menu\n</span>        at<span class="token punctuation" >:</span> <span class="token punctuation" >{</span> x<span class="token punctuation" >:</span> <span class="token number" >30</span><span class="token punctuation" >,</span> y<span class="token punctuation" >:</span> <span class="token number" >30</span> <span class="token punctuation" >}</span><span class="token punctuation" >,</span>               <span class="token comment" spellcheck="true">// The at object positions the menu (if you want to do it manually)\n</span>        show<span class="token punctuation" >:</